import { getAuth, signOut } from "firebase/auth";

function Home(){
    // const [errMsg, setErrMsg] = useState("");
    const auth = getAuth();
signOut(auth).then(() => {
    console.log("Log Out")
}).catch((error) => {
  console.log("error");
});
    return(
        <div className={styles.container}>
            <h1 className={styles.heading}>TODO Home Application</h1>
            <Link to="/Login"><button>Log Out</button></Link>
          <div className={styles.innerBox}>
          <InputControl />

          </div>

        </div>
    )
}

export default Home;
